const App = () => {
    console.log('Hello from component ', a + b)
    const now = new Date()
    const a = 10
    const b = 20
    console.log(now, a + b)
    return (
        < div >
            <p>Hello world it now {now.toString()}</p>
            <p>
                {a} + {b} is {a + b}
            </p>
        </div >
    )
}

export default App
